commits.sourceNew:
/**
 * Returns true if a mapping for the specified start offset exists
 * 
 * @param s startOffset
 * @return true if there are tokens for the startOffset
 */
public boolean isStartExist(int s) {
  return tokenListTable.get(new Integer(s)) != null;
}

